CREATE TABLE `shipment_fact` (
  `Shipment_Fact_Key` int NOT NULL AUTO_INCREMENT,
  `Shipment_ID` varchar(10) NOT NULL,
  `Quantity` int NOT NULL,
  `Product` int NOT NULL,
  `Origin` int NOT NULL,
  `Destination` int NOT NULL,
  `Vendor` int NOT NULL,
  `Date_Departed` int NOT NULL,
