  KEY `fk_Shipment Fact_Date Dimension1_idx` (`Date_Departed`),
  KEY `fk_Shipment Fact_Time Dimension1_idx` (`Time_Departed`),
  KEY `fk_Shipment Fact_Timezone Dimension1_idx` (`Timezone_Departed`),
  KEY `fk_Shipment Fact_Date Dimension2_idx` (`Date_Arrived`),
