  CONSTRAINT `fk_Shipment Fact_Date Dimension2` FOREIGN KEY (`Date_Arrived`) REFERENCES `date_dimension` (`Date_Key`),
  CONSTRAINT `fk_Shipment Fact_Port Dimension1` FOREIGN KEY (`Destination`) REFERENCES `port_dimension` (`Port_Key`),
